        <script type="text/javascript">
          
            
            const audio = document.querySelector('#audio');

            let myReq = null;

            let imgReq = [];

            function fireConfetti(){
                const end = Date.now() + 15 * 500;

                // go Buckeyes!
                const colors = ["#bb0000", "#ffffff"];


                (function frame() {
                    confetti({
                        particleCount: 2,
                        angle: 60,
                        spread: 55,
                        origin: { x: 0 },
                        colors: colors,
                    });

                    confetti({
                        particleCount: 2,
                        angle: 120,
                        spread: 55,
                        origin: { x: 1 },
                        colors: colors,
                    });

                    if (Date.now() < end) {
                        myReq = requestAnimationFrame(frame);
                    }


         
                })();
            }


            
            let sf = (window.screen.width * .25);
            
            let lefOptions = [
                0,
                sf,
                sf+sf,
                sf+sf+sf
            ];
            

             


            const openBtn = document.querySelector(".js-card-opener");
            const msg = document.querySelector('#msg');
            openBtn.onclick = function () {

                document.body.classList.toggle("open");

                let card_container = document.querySelector('.card__container');
                
                if(document.body.classList.contains('open')){
                    
                    card_container.style.left = '150%';
                    audio.play();
               
                    fireConfetti();

                    setTimeout(()=>{
                        msg.scrollIntoView();
                        
                    },1000)
                    
                    

                }else{
                    
                    card_container.style.left = '50%';
                    audio.pause();
                    audio.currentTime = 0;
               
                    if(myReq != null){
                        cancelAnimationFrame(myReq);
                        myReq = null;
                    }

                }
                
            };


        </script>
